import { StatusBar } from "expo-status-bar"
import {Button, StyleSheet, Text, View, FlatList} from "react-native"
import { ListItem, List } from "react-native-elements";



export default function Odenes(){
    const DATA = [
        {
          id: '001',
          cliente: 'Juan',
          status:'Preparacion'
        },
        {
          id: '002',
          cliente: 'luis',
          status: 'entregado'
        },
        {
          id: '003',
          cliente: 'Maria',
          status:'preparacion'
        },
    ];
    return(
        <View>
            <Button title="Nueva Orden" onPress={() => navigation.navigate("Nuevo")} />
            <List>
                <FlatList
                    data={DATA}
                    keyExtractor={(item) => item.id}
                    renderItem={({item}) => (
                     <ListItem  >
                        title={item.cliente}
                        subtitle={item.status}
                       
                    </ListItem>

                    )}
                />
            </List>
        </View>
    );
}
